import { AUTH } from '../constants/actionTypes'
import * as api from '../api'

export const signin = (formData, nav) => async (dispatch) => {
  try {
    nav('/', { replace: true })
  } catch (error) {
    console.log(error)
  }
}

export const signup = (formData, nav) => async (dispatch) => {
  try {
    nav('/', { replace: true })
  } catch (error) {
    console.log(error)
  }
}
